class Lookups {
    Lookups({name, id}){
        this.id = id;
        this.name = name;
    }
}

export const itemOrderByLookups = [
    new Lookups("publishedDate", 1),
    new Lookups("tradez", 2),
    new Lookups("approximatePrice", 3)
]
